import React from 'react';

const Playder = () => {
    return (
        <div className='px-5 flex '>
            <div className='w-[30%]'>
                <div>
                    imd
                </div>
            </div>
            <div className='w-[40%]'>
                contet
            </div>
            <div className='w-[30%]'>
                Playder right
            </div>
        </div>
    );
}

export default Playder;
